const moves = {
  U: function(key) {
    return (key>3?key-3:key);
  },
  R: function(key) {
    return (key%3!==0?key+1:key);
  },
  D: function(key) {
    return (key<7?key+3:key);
  },
  L: function (key) {
    return (key%3!==1?key-1:key);
  }
}

function getKey(data, key) {
  if (data.length > 0) {
    let str = data.shift();
    str.split('').forEach((dir) => {
      let okey = key;
      key = moves[dir](key);
    });
    return key + getKey(data, key);
  }
  return '';
}

